import React from 'react';
import { Route, Switch } from 'react-router';
import Home from './containers/Home';

const Router = () => {
    return (
        <>
            <Switch>
                <Route exact path={'/'} component={Home} />
            </Switch>
        </>
    );
};
export default Router;
